/*Table structure for table `customer_trace_record` */

DROP TABLE IF EXISTS `customer_trace_record`;

CREATE TABLE `customer_trace_record` (
  `record_id` int(16) NOT NULL AUTO_INCREMENT COMMENT '客户id',
  `customer_id` int(10) DEFAULT NULL COMMENT '客户ID',
  `user_id` int(10) DEFAULT NULL COMMENT '咨询师id',
  `channel` int(2) DEFAULT NULL COMMENT '访问渠道',
  `record_date` datetime DEFAULT NULL COMMENT '咨询日期',
  `times` varchar(30) DEFAULT NULL COMMENT '时间戳',
  `content` varchar(500) DEFAULT NULL COMMENT '内容',
  PRIMARY KEY (`record_id`),
  KEY `user_id` (`user_id`),
  KEY `customer_id` (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8;

/*Data for the table `customer_trace_record` */

insert  into `customer_trace_record`(`record_id`,`customer_id`,`user_id`,`channel`,`record_date`,`times`,`content`) values (1,32,1061,NULL,'2017-01-06 21:24:37',NULL,'会考虑技术，周三试听'),(2,129,1061,NULL,'2017-01-10 15:03:38',NULL,'之前在国兴花费1万7学习，老师是1年左右工作的老师，没学到东西费用是贷款产生的，现在公司倒闭还在还债压力。但是个人还是对技术感兴趣的，邀约明天试听'),(3,270,1061,NULL,'2017-01-16 16:26:57',NULL,'我的记录'),(4,275,1049,NULL,'2017-01-16 16:30:08',NULL,'我的'),(5,24,1049,NULL,'2017-01-16 16:40:04',NULL,'2016.1.7  \r\n回老家了，不考虑'),(6,173,1049,NULL,'2017-01-16 16:40:52',NULL,'2016.1.13   \r\n\r\n不考虑技术'),(7,233,1049,NULL,'2017-01-16 17:07:07',NULL,'2017.1.14  已跟进\r\n找到个寒假工作'),(8,104,1049,NULL,'2017-01-16 17:07:43',NULL,'2016.1.10已跟进\r\n觉得技术不适合自己'),(9,201,1049,NULL,'2017-01-16 18:36:32',NULL,'2016.1.14 已跟进\r\n回老家了\r\n\r\n'),(10,125,1061,NULL,'2017-01-17 12:51:35',NULL,'朋友做维护的  要和朋友商量下，后续跟进'),(11,115,1061,NULL,'2017-01-17 12:55:33',NULL,'有谈过会考虑技术，但是意愿不强，后续确定意向'),(12,142,1061,NULL,'2017-01-17 13:00:33',NULL,'要回去和家里的哥哥姐姐商量，自己没信心，'),(13,311,1061,NULL,'2017-02-04 16:43:28',NULL,'昨天和表姐才到深圳，没地方住。表姐本科学历，想做文员，自己想学技术，有邀约试听，周一过深圳。'),(14,301,1061,NULL,'2017-02-04 16:49:17',NULL,'自己有考虑做技术，但是没想到y要培训，和朋友一起住平洲，讲了我们的教学模式，说是自己考虑清楚，有约周一试听，加了微信，在继续跟进，让他和他朋友一起过来试听。'),(15,285,1061,NULL,'2017-02-04 16:54:54',NULL,'交了订坐 200元，之前在湖南做.net3-4k,很多朋友和同学在深圳做Java开发和其他  有一些拿一万多，自己也想赚钱 刚来深圳。约周一试听 现在住罗笋岗  床位'),(16,286,1049,NULL,'2017-02-06 19:13:46',NULL,'今天来试听了一上午，想学php，在对比机构'),(17,301,1061,NULL,'2017-02-07 11:31:19',NULL,'找锦云姐姐打电话回访，直接挂断。5号的时候有聊微信说在家睡觉，后续就挂断电话。'),(18,365,1061,NULL,'2017-02-07 11:32:13',NULL,'锦云姐姐帮忙回访，约明天试听。'),(19,349,1061,NULL,'2017-02-07 11:37:07',NULL,'今天打电话停机了。微信跟进'),(20,344,1061,NULL,'2017-02-07 11:45:42',NULL,'电话打了三次没接通，微信跟进、\r\n'),(21,331,1061,NULL,'2017-02-07 11:47:45',NULL,'刚从学校出来，在学校的时候接触过校企合作的培训4个月，还是想找找工作，然后再说，可以保持联系'),(22,423,1061,NULL,'2017-02-07 15:06:20',NULL,'要回去问老公，想做文员，介绍了文员的危机，有点兴趣主要还是老公，老公做电子信息工程的，明天以企业合作部名义问技术和老公的态度。'),(23,400,1061,NULL,'2017-02-07 15:14:39',NULL,'江苏人，性子好。13年花费1万7左右在上海学的测试，出来有两份测试工作，主要做报告，功能测试性能测试都有接触，linux系统也学过就是不熟，刚到深圳几天，朋友说深圳机会多，加上微信，晚点电话或者微信确认，约明天试听。'),(24,417,1061,NULL,'2017-02-07 16:26:13',NULL,'现在住关外，等明天他朋友回来和他朋友后天一起过来。该说的都说了，后续就微信联系咯'),(25,344,1061,NULL,'2017-02-08 09:05:19',NULL,'7号晚上8点多电话沟通，回去和姐姐沟通了姐姐没有绝对的反对但是还是不放心，让他自己多看看多对比，姐姐不上班也会和他一起去了解，有说下周开班，让他和姐姐周六可以过来试学，随时保持联系。'),(26,447,1061,NULL,'2017-02-08 16:06:50',NULL,'面试完安排进Java班试听三分钟走了，后续电话回访说是想先工作，之前在学校创新中心有博士老师带，找了技术支持还是不行，让他去碰碰壁在后续看情况'),(27,518,1061,NULL,'2017-02-08 16:11:13',NULL,'明天下午有个硬件测试面试，约了明天早上试听。不熟 多关心和多接触。'),(28,417,1061,NULL,'2017-02-08 16:16:11',NULL,'打完电话，今天接朋友去了，住在福永桥头然后明天跟进安排试听并且入住。'),(29,344,1061,NULL,'2017-02-08 16:30:17',NULL,'明天试听，九点半'),(30,547,1061,NULL,'2017-02-09 17:31:31',NULL,'交了100块钱的订座，没讲费用。明天试听'),(31,540,1061,NULL,'2017-02-09 17:33:44',NULL,'回去考虑，是朋友建议过来看看的。约试听没答应，今晚跟进、'),(32,585,1061,NULL,'2017-02-09 17:38:11',NULL,'回去和男朋友商量下，都有负债，自己还要考虑，后续跟进。'),(33,580,1061,NULL,'2017-02-09 17:40:26',NULL,'自己自学了一个学期前端，来我们公司面试之前去过其他web公司面试都是说技术部过关，自己可以接受培训但是要考虑和考察，约了明天试听。'),(34,573,1061,NULL,'2017-02-09 17:44:58',NULL,'想学习测试 就是费用有问题  说回去考虑考虑  明天回访'),(35,615,1061,NULL,'2017-02-10 16:27:22',NULL,'自己技术是学校实训出来的，比较谦虚，后续技术复试 下周一'),(36,651,1069,NULL,'2017-02-11 14:18:54',NULL,'不考虑学习暂时'),(37,761,1061,NULL,'2017-02-13 16:37:10',NULL,'自己不想在家里，也知道现在传统行业不好做，交了500押金，想学web'),(38,771,1061,NULL,'2017-02-13 16:43:52',NULL,'之前做发型师，身体过敏所以现在不知道做什么，分析了技术，行业对比。交了200押金，明天试听'),(39,758,1061,NULL,'2017-02-13 16:47:36',NULL,'跟他分析了现在C++技术的发展和其他技术的发展，说是会回去考虑下想来会回复我。留了我的手机号，'),(40,776,1047,NULL,'2017-02-13 18:12:19',NULL,'我想学!!'),(41,705,1059,NULL,'2017-02-13 18:37:46',NULL,'不考虑了，有朋友也是做培训的 如果真想学也可以去朋友那里，所以不来了'),(42,735,1061,NULL,'2017-02-13 18:43:16',NULL,'刚来深圳，想学技术但是不想付出，说了一些法则，让他自己去面试看看。长跟'),(43,729,1061,NULL,'2017-02-13 18:45:55',NULL,'自己想学习技术，也知道要实训，现在在对比机构。跟紧'),(44,777,1073,NULL,'2017-02-13 18:51:39',NULL,'想学'),(45,777,1073,NULL,'2017-02-13 18:51:52',NULL,'明天报名'),(46,714,1061,NULL,'2017-02-13 18:51:59',NULL,'啥都说了，就是说哥哥不同意走技术方向，要回去问哥哥  感觉像探子'),(47,777,1073,NULL,'2017-02-13 18:52:00',NULL,'进班'),(48,706,1061,NULL,'2017-02-13 18:55:14',NULL,'已婚有宝宝 但是老公没工作 现在在厂里做硬件财测试，给她讲了软件测试  后续跟进  一弄清她家里的情况  二是讲软件测试能给到她什么样的'),(49,722,1059,NULL,'2017-02-13 19:10:04',NULL,'听朋友说不太合适，举例说了小马过河的例子，自己说在考虑一下  最后决定先找工作  没合适的在来 跟进'),(50,531,1049,NULL,'2017-02-13 19:46:39',NULL,'  找到销售工作 继续跟进'),(51,623,1049,NULL,'2017-02-13 19:51:56',NULL,'找到JAVA开发的工作'),(52,577,1049,NULL,'2017-02-13 20:05:20',NULL,'还是想往行政工作去发展'),(53,346,1049,NULL,'2017-02-13 20:10:50',NULL,'想找客服工作'),(54,704,1069,NULL,'2017-02-13 20:10:55',NULL,'今天试听了，觉得英语0基础，难，不感兴趣，跟进'),(55,628,1069,NULL,'2017-02-13 20:15:15',NULL,'已经试听，觉得英语难，不想学，跟进'),(56,798,1061,NULL,'2017-02-14 12:39:54',NULL,'今天面试，家里做批发的父母不想他走父母老路让他出来工作，讲了发展和应届生的发展流程，回去问问父母意见。跟进好，晚上7点跟进好。'),(57,908,1061,NULL,'2017-02-14 16:40:39',NULL,'都聊完了，回去和姐姐家里人商量 有打预防针。自己改变，靠自己'),(58,716,1049,NULL,'2017-02-14 18:16:46',NULL,'不接受培训'),(59,757,1049,NULL,'2017-02-14 18:17:47',NULL,'姐姐说学费太贵，不让培训 继续跟进'),(60,756,1049,NULL,'2017-02-14 18:18:29',NULL,'跟蔡叶琴一起来的，家人不同意'),(61,778,1049,NULL,'2017-02-14 18:19:26',NULL,'有学计算机的朋友学的不怎么样  觉得自己没点基础更学不会'),(62,712,1049,NULL,'2017-02-14 18:19:51',NULL,'晚上跟堂哥商量下'),(63,723,1049,NULL,'2017-02-14 18:22:05',NULL,'家人还是想让她找工作看看'),(64,905,1049,NULL,'2017-02-14 18:34:09',NULL,' 明天想去面试其他培训机构'),(65,778,1049,NULL,'2017-02-15 09:03:40',NULL,'不考虑学习了'),(66,882,1049,NULL,'2017-02-15 09:06:31',NULL,'学生上午有事情 下午再联系我'),(67,712,1049,NULL,'2017-02-15 09:17:00',NULL,'自己想多对比几家机构'),(68,885,1049,NULL,'2017-02-15 09:51:38',NULL,'对技术不感兴趣  不考虑了'),(69,871,1073,NULL,'2017-02-15 19:16:17',NULL,'已退订座，因为学费的问题还是想找一份直接上岗的工作'),(70,1046,1061,NULL,'2017-02-15 19:16:29',NULL,'回去考虑，和姐姐商量   自己想做，可以带姐姐来了解'),(71,882,1049,NULL,'2017-02-15 19:45:22',NULL,'下午给我微信不考虑学习了 继续跟进'),(72,905,1049,NULL,'2017-02-15 19:46:50',NULL,'发微信来想退订座费，继续跟进。电话未接'),(73,723,1049,NULL,'2017-02-15 19:48:01',NULL,'微信未回 电话未接'),(74,917,1049,NULL,'2017-02-15 20:15:41',NULL,'不考虑了  经济问题  更想找份有工资的工作'),(75,882,1049,NULL,'2017-02-17 20:15:26',NULL,'找到工作了 不考虑学了\r\n'),(76,723,1049,NULL,'2017-02-17 20:19:31',NULL,'找到工作了'),(77,905,1049,NULL,'2017-02-17 20:47:20',