/*Table structure for table `employee_info` */

DROP TABLE IF EXISTS `employee_info`;

CREATE TABLE `employee_info` (
  `user_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `name` varchar(32) NOT NULL COMMENT '用户名',
  `password` varchar(128) NOT NULL,
  `salt` varchar(32) DEFAULT NULL,
  `wechat_no` varchar(30) DEFAULT NULL COMMENT '微信号',
  `tel` varchar(20) DEFAULT '' COMMENT '手机号',
  `real_name` varchar(32) DEFAULT NULL COMMENT '用户姓名',
  `dept_id` int(11) DEFAULT NULL,
  `company_id` int(11) NOT NULL,
  `create_by` varchar(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_by` varchar(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `isDelete` int(11) DEFAULT NULL,
  `isLocked` varchar(2) DEFAULT '0' COMMENT '是否禁用用户:0:不禁用.1:禁用 默认为:0',
  `gender` varchar(10) DEFAULT NULL,
  `isConsultant` varchar(10) DEFAULT '0' COMMENT '0：不是咨询师,1:是咨询师 默认为:0',
  `email` varchar(32) DEFAULT NULL,
  `isEmailActive` varchar(5) DEFAULT '0' COMMENT '邮件是否发送成功:0:不成功，1：成功,默认:0',
  `resource_ids` text,
  `isPermission` varchar(5) DEFAULT '0' COMMENT '是否授权:0:没有授权,1:权限授权，2:角色授权,默认为:0',
  `role_name` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1116 DEFAULT CHARSET=utf8;

