/*Table structure for table `import_info` */

DROP TABLE IF EXISTS `import_info`;

CREATE TABLE `import_info` (
  `customer_id` int(16) NOT NULL AUTO_INCREMENT COMMENT '客户id',
  `real_name` varchar(30) DEFAULT NULL COMMENT '客户姓名',
  `sex` int(2) DEFAULT '1' COMMENT '性别[1-男  2-女]',
  `age` int(3) DEFAULT NULL COMMENT '年龄',
  `native_place` varchar(120) DEFAULT NULL COMMENT '籍贯',
  `tel` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `wechat_no` varchar(30) DEFAULT NULL COMMENT '微信账号',
  `qq` varchar(20) DEFAULT NULL COMMENT '扣扣号',
  `education_bg` int(2) DEFAULT NULL COMMENT '学历[1-小学 2-初中 3-高中 4-大专 5-本科 6-研究生 0-其他]',
  `graduate_time` varchar(20) DEFAULT NULL COMMENT '毕业时间',
  `graduate_from` varchar(50) DEFAULT NULL COMMENT '毕业院校',
  `major_in` varchar(50) DEFAULT NULL COMMENT '专业',
  `work_age` int(2) DEFAULT NULL COMMENT '工作年限',
  `work_experience` varchar(500) DEFAULT NULL COMMENT '工作经历',
  `job` varchar(50) DEFAULT NULL COMMENT '从事职业',
  `educate_experience` varchar(500) DEFAULT NULL COMMENT '教育培训经历',
  `recruit_channel` int(2) DEFAULT NULL COMMENT '应聘渠道[1-智联 2-前程无忧 3-58同城 4-转介绍 5-中华英才 6-其他待定]',
  `customer_state` int(2) DEFAULT NULL COMMENT '客户状态[待定]已报名，已就业，意向[],无效',
  `customer_level` varchar(2) DEFAULT NULL COMMENT '客户级别[待定]（ABCD）',
  `user_id` int(16) DEFAULT '0' COMMENT '咨询师id',
  `apply_job` varchar(128) DEFAULT NULL COMMENT '应聘职位',
  `live_address` varchar(128) DEFAULT NULL COMMENT '目前居住地',
  `cur_income` varchar(128) DEFAULT NULL COMMENT '目前年收入',
  `license` varchar(64) DEFAULT NULL COMMENT '应聘公司(招聘执照)',
  `expect_salary` varchar(128) DEFAULT NULL COMMENT '期望月薪(税前)',
  `job_status` varchar(64) DEFAULT NULL COMMENT '求职状态',
  `introducer` varchar(50) DEFAULT NULL COMMENT '推荐人（创量部电话邀约）',
  `memo` varchar(500) DEFAULT NULL COMMENT '备注',
  `send_time` date DEFAULT NULL COMMENT '投递(应聘)时间',
  `last_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后跟进时间 格式2015-10-09',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `company_id` int(11) DEFAULT NULL,
  `isDelete` int(11) DEFAULT '0' COMMENT '逻辑删除数据:0不删除,1删除',
  `guandan` int(11) DEFAULT NULL COMMENT '关单人',
  `isMarket` varchar(2) DEFAULT '3' COMMENT '是否是会销(0:是,1:不是)，其他',
  `cvType` int(11) DEFAULT '1' COMMENT '导入的简历类型(1:投递的简历,2:下载的简历)',
  PRIMARY KEY (`customer_id`),
  KEY `customer_state` (`customer_state`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1151 DEFAULT CHARSET=utf8;

