/*Table structure for table `tb_menu_app` */

DROP TABLE IF EXISTS `tb_menu_app`;

CREATE TABLE `tb_menu_app` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` varchar(20) DEFAULT '0' COMMENT 'm开头的是桌面按钮，0：普通资源，1:是按钮资源',
  `icon` varchar(32) DEFAULT NULL COMMENT '图标',
  `iconbg` varchar(255) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL COMMENT '桌面图表名称',
  `url` varchar(128) DEFAULT NULL COMMENT '超链接地址',
  `pId` int(11) DEFAULT NULL,
  `permission` varchar(255) DEFAULT NULL,
  `available` tinyint(255) DEFAULT '1' COMMENT '该资源是否可用:0:不可用，1：可用,默认为1',
  `checked` bit(1) DEFAULT NULL,
  `open` bit(1) DEFAULT NULL,
  `iconSkin` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8;

